db.transaction().execute(async (trx) => {
  const customers = await trx
    .insertInto("Customer")
    .values({
      name: "John Doe",
      email: "john.doe@example.com",
      isActive: false,
    })
    .returning([
      "Customer.id",
      "Customer.name",
      "Customer.email",
      "Customer.isActive",
    ])
    .execute();

  const customerId = customers[0].id;

  const insertedOrders = await trx
    .insertInto("Order")
    .values({
      customerId: customerId,
      date: new Date(),
      totalAmount: 100.5,
    })
    .returning(["Order.id"])
    .execute();

  const orderId = insertedOrders[0].id;

  await trx
    .insertInto("_OrderProducts")
    .values([
      { A: orderId, B: 1 },
      { A: orderId, B: 2 },
    ])
    .execute();
})

